import React, { useState } from 'react'

const AddToList = () => {
    const changeHandler = (e: any) => {
        console.log(e.target.value);

    }
    const [input, setInput] = useState({
        name: "",
        phone: "",
        roll: "",
        work: ""
    })
    return (
        <>
            <div >
                <div> <input
                    type="text"
                    placeholder='name'
                    value={input.name}
                    onChange={changeHandler}
                /></div> <br />
                <div>  <input
                    type="text"
                    placeholder='Phone Number'
                    value={input.phone}
                /></div> <br />
                <div>   <input
                    type="text"
                    placeholder='Roll Number'
                    value={input.roll}
                /></div> <br />
                <div>   <textarea
                    placeholder='Job' cols={26} value={input.work}
                /></div>
            </div>
        </>
    )
}

export default AddToList
